import React from 'react';
import Button from 'react-bootstrap/Button';

function TopicButton({ topicName, setChosenTopic, variantName }) {

    return (
        <Button
            variant={variantName}
            onClick={() => {
                setChosenTopic(topicName);
            }}
        >{topicName}</Button>
    );
}

export default TopicButton;
